import React from 'react';
import Card from './Card';
import CardData from './CardInfo';


function MyApp() {
  return (
    <>
     {/* <h1 className="heading_style">List of Top 4 Netflix Shows: Yuva React App</h1> */}
     <h1 className="heading_style"></h1>
      {CardData.map((item)=>{
        return (
          <Card
            src={item.mySrc}
            link={item.myLink}
            category={item.myCategory}
            title={item.myTitle}
          />
          
        );
      })} 
      <nav className='navbar'>
        <div className='btn-group'>
          <button className='btn-group_item'>Series</button>
          <button className='btn-group_item'>Movies</button>
          <button className='btn-group_item'>Documentries</button>
          
        </div>
      </nav>
    </>
  )}

export default MyApp;
